#include "common.h"

class QuadGraph{
public:	
	QuadGraph(const std::pair<int, int>& cood, bool bFlip = true)
		: m_ijCood(cood)
		, m_bFlip(bFlip)
	{}

	~QuadGraph(){
		m_subNodes.clear();
	}

	void AddSubNode(QuadGraph& subNode){
		m_subNodes.push_back(&subNode);
	}

	void AddSubNode(QuadGraph* subNode){
		m_subNodes.push_back(subNode);
	}

	std::pair<int, int> m_ijCood;
	vector<QuadGraph*> m_subNodes;
	bool m_bFlip;
};

class Solution {
public:
	void solve(vector<vector<char>>& board) {
		return solve_iterative(board);
	}

	void solve_iterative(vector<vector<char>>& board) {
		vector<QuadGraph*> vGraphs;
		for (int i = 0; i < board.size(); ++i){
			for (int j = 0; j < board[0].size(); ++j){
				if (board[i][j] == 'O'){
					QuadGraph* g = BuildTree(i, j, board);
					vGraphs.push_back(g);
				}
			}
		}

		for (int i = 0; i < vGraphs.size(); ++i){
			processOneGraph(*vGraphs[i], board);
		}
	}

	QuadGraph* BuildTree(int i, int j, vector<vector<char>>& board){
		QuadGraph* pRoot = new QuadGraph(pair<int, int>(i, j));
		vector<QuadGraph*> stackNode(1, pRoot);
		board[i][j] = '1'; // mark gray;

		while (!stackNode.empty())
		{
			QuadGraph* pNode = stackNode.back();
			stackNode.pop_back();
			board[pNode->m_ijCood.first][pNode->m_ijCood.second] = '1'; // mark gray;

			for (int k = 0; k < 4; ++k){
				int m = pNode->m_ijCood.first;
				int n = pNode->m_ijCood.second;
				switch (k)
				{
				case 0:
					m = m - 1;
					n = n;
					break;
				case 1:
					m = m;
					n = n - 1;
					break;
				case 2:
					m = m;
					n = n + 1;
					break;
				case 3:
					m = m + 1;
					n = n;
					break;
				default:
					printf("OOPS!!! sth wrong here.\n");
					break;
				}

				if (m < 0 || m >= board.size() || n < 0 || n >= board[0].size()){
					pNode->m_bFlip = false;
					continue;
				}

				if (board[m][n] != 'O'){
					continue;
				}

				QuadGraph* pNext = new QuadGraph(pair<int, int>(m, n));
				pNode->AddSubNode(pNext);
				stackNode.push_back(pNext);
			}

			board[pNode->m_ijCood.first][pNode->m_ijCood.second] = '2'; // mark black;
		}

		//pRoot->m_bFlip = bFlip;
		return pRoot;
	}

	void solve_rec(vector<vector<char>>& board) {
		vector<QuadGraph> vGraphs;
		for (int i = 0; i < board.size(); ++i){
			for (int j = 0; j < board[0].size(); ++j){
				if (board[i][j] == 'O'){
					QuadGraph g(pair<int, int>(i, j));
					bool bFlip = true;
					BuildGraph(i, j, board, g, bFlip);
					vGraphs.push_back(g);
				}
			}
		}

		for (int i = 0; i < vGraphs.size(); ++i){
			processOneGraph(vGraphs[i], board);
		}
	}

	bool BuildGraph(int i, int j, vector<vector<char>>& board, QuadGraph& g, bool& bFlip){
		if (i < 0 || j < 0 || j >= board[0].size() || i >= board.size()){
			bFlip = false;
			return false;
		}

		if (board[i][j] != 'O')
			return false;

		board[i][j] = '1';
		QuadGraph gU(pair<int, int>(i - 1, j));
		if (BuildGraph(i - 1, j, board, gU, bFlip))
			g.AddSubNode(gU);

		QuadGraph gL(pair<int, int>(i, j - 1));
		if (BuildGraph(i, j - 1, board, gL, bFlip))
			g.AddSubNode(gL);

		QuadGraph gR(pair<int, int>(i, j + 1));
		if (BuildGraph(i, j + 1, board, gR, bFlip))
			g.AddSubNode(gR);

		QuadGraph gB(pair<int, int>(i + 1, j));
		if (BuildGraph(i + 1, j, board, gB, bFlip))
			g.AddSubNode(gB);

		board[i][j] = '2';
		g.m_bFlip = bFlip;
		return true;
	}

	void processOneGraph(QuadGraph& g, vector<vector<char> > & board){
		bool bFlip = getGraphStatus(g);
		if (bFlip){
			traversalGraphSet(g, 'X', board);
		}else{
			traversalGraphSet(g, 'O' ,board);
		}
	}

	bool getGraphStatus(QuadGraph& g){
#if 0
		if (!g.m_bFlip)
			return false;
		else{
			bool ret = true;
			for (int i = 0; ret && i < g.m_subNodes.size(); ++i){
				ret &= getGraphStatus(*g.m_subNodes[i]);
			}
			return ret;
		}
#endif
		vector<QuadGraph*> stackNode(1, &g);
		while (!stackNode.empty()){
			QuadGraph* pNode = stackNode.back();
			stackNode.pop_back();

			if (!pNode->m_bFlip)
				return false;

			stackNode.insert(stackNode.end(), pNode->m_subNodes.begin(), pNode->m_subNodes.end());
		}
		return true;
	}

	void traversalGraphSet(QuadGraph& g, char ch, vector<vector<char> > & board){
		vector<QuadGraph*> stackNode(1, &g);
		while (!stackNode.empty()){
			QuadGraph* pNode = stackNode.back();
			stackNode.pop_back();
			board[pNode->m_ijCood.first][pNode->m_ijCood.second] = ch;
			stackNode.insert(stackNode.end(), pNode->m_subNodes.begin(), pNode->m_subNodes.end());
		}
	}
};

